within_5min	Anzahl innerhalb einer Wegzeit von 5min	var count=0;\nvar descriptionField=lc.table.textField('description');\nfor each (var target in lc.orderedTargets) {\n        if (target.time>5) break;\n        var description = descriptionField.get(target.rec);\n        target.caption = "<b>#" + count + ": " + description + "</b>" \n               + "<br>Wegzeit Minuten: " +  target.time;\n        lc.keep(target);\n        count++;\n};\nlc.result=count;	Ziele
next_value	Wert des nächsten Objekts aus der "value" Spalte	var valueField=lc.table.doubleField('value');\nfor each (var target in lc.orderedTargets) {\n        target.value = valueField.get(target.rec);\n        target.caption = "<b>Wert: " + target.value  + "</b>"  \n               + "<br>Luftlinendistanz: " + target.distance;\n        lc.keep(target);\n        lc.result = target.value;\n        break;\n};	
next_time	Zeit bis zum fahrzeitbezogen nächsten Objekt	var cnt=0;\nvar result=0;\nvar descriptionField=lc.table.textField('description');\nfor each (var target in lc.orderedTargets) {\n        lc.result = target.time;\n        var description = descriptionField.get(target.rec);\n        target.caption = "<b>" + description + "</b>" \n               + "<br>Wegzeit Minuten: " +  lc.result;\n        lc.keep(target);\n        break;\n};	Minuten
within_10min	Anzahl innerhalb einer Wegzeit von 10min	var count=0;\nvar descriptionField=lc.table.textField('description');\nfor each (var target in lc.orderedTargets) {\n        if (target.time>10) break;\n        var description = descriptionField.get(target.rec);\n        target.caption = "<b>#" + count + ": " + description + "</b>" \n               + "<br>Wegzeit Minuten: " +  target.time;\n        lc.keep(target);\n        count++;\n};\nlc.result=count;	Ziele
within_15min	Anzahl innerhalb einer Wegzeit von 15min	var count=0;\nvar descriptionField=lc.table.textField('description');\nfor each (var target in lc.orderedTargets) {\n        if (target.time>15) break;\n        var description = descriptionField.get(target.rec);\n        target.caption = "<b>#" + count + ": " + description + "</b>" \n               + "<br>Wegzeit Minuten: " +  target.time;\n        lc.keep(target);\n        count++;\n};\nlc.result=count;	Ziele
